// utils/path.ts
function splitPathAndFile(filePath) {
  const lastSlashIndex = filePath.lastIndexOf("/");
  if (lastSlashIndex !== -1) {
    const path = filePath.substring(0, lastSlashIndex);
    const file = filePath.substring(lastSlashIndex + 1);
    return [path, file];
  } else {
    return [filePath, ""];
  }
}

